  var owl = $('.owl-carousel');
  owl.owlCarousel({
    items: 1,
    dots: false
  });
  owl.on('changed.owl.carousel', function(event) {
    console.log('CHANGED:', event);
    $('.carouselNavItem a').each(function(){
      $(this).removeClass('active');
    });
    $('.carouselNavItem a').eq(event.item.index).addClass('active');
  });

  $('.carouselNavItem a').on('click', function(e) {
    e.preventDefault();
    var n = e.target.getAttribute('data-slide');
    console.log('ok', n);
    n=parseInt(n)
    owl.trigger('to.owl.carousel', [n, 300]);

  });
